import Draggable from 'react-draggable';
import ControlBar from '../ControlBar.jsx';

function ProjectsFile() {
    const offSetX = 150;
    const offSetY = -80;
    return (
        <Draggable
            handle=".handle"
            defaultPosition={{x: offSetX, y: offSetY}}
        >
            <ControlBar />
            <div className="flex flex-col gap-4">
                <h2>Projects</h2>
            </div>
        </Draggable>
    )
}

export default ProjectsFile;
